import React, { useRef, useState, useEffect } from "react";
import { Redirect } from 'react-router';
import { Header } from "../../common/Header";
import {
    MDBBtn,
    MDBFreeBird,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBCardText,
    MDBCol,
    MDBContainer,
    MDBFormInline,
    MDBIcon,
    MDBInput,
    MDBRow,
    MDBTable,
    MDBTableBody,
    MDBTableHead,
    MDBEdgeHeader,
    MDBCardTitle,
    MDBProgress,
    MDBListGroup,
    MDBListGroupItem,
    MDBBreadcrumbItem,
    MDBBreadcrumb
} from "mdbreact";
import { useHistory } from "react-router";
import { Chart } from "react-google-charts";
import "./style.css"
export const Services = (props: any) => {
    const token = localStorage.getItem("token");
    console.log(props)
    if (token === undefined) {
        return <Redirect to={{
            pathname: '/login',
        }} />
    }
    return (
        <>
            <MDBContainer fluid className="pb-5" style={{ padding: "2vw" }}>
                <MDBRow>
                     <MDBCol className="awsServices" sm="3" md="3" lg="3" >
                     <img className="alignleft" src="https://cdn.mindmajix.com/blog/images/aws-s3-010621.webp" alt="Amazon S3" width="100" height="121" />
                    </MDBCol>
                    <MDBCol sm="1" md="1" lg="1" ></MDBCol>
                    <MDBCol className="awsServices" sm="3" md="3" lg="3" >
                     <img className="alignleft" src="https://cdn.mindmajix.com/blog/images/aws-s3-010621.webp" alt="Amazon S3" width="100" height="121" />
                    </MDBCol>
                </MDBRow>
            </MDBContainer>
        </>
    )
}
